import './App.css';
import Chart from 'chart.js/auto';

let os = null;
let browser = null;
let type = null;
let n1 = null;
let n2 = null;
let data = [];
let startDate = null;
let dataDate = null;

function App() {
  return (
    <div className="App">
    <div class="title has-grey-background"><h1>Igor's Challenge</h1></div>
    <div>
      <select id="type">
        <option value="start">Start</option>
      </select>
</div>
    <div>
      <select id="os" className="invisible">
        <option value="windows">Windows</option>
        <option value="linux">Linux</option>
        <option value="mac">Mac</option>
      </select>
      <select id="browser" className="invisible">
        <option value="chrome">Chrome</option>
        <option value="mozilla">Mozilla</option>
        <option value="iexplorer">Internet Explorer</option>
      </select>
    </div>
    <div><input id="n1" className="invisible" type="number"  placeholder="give a value"/><input id="n2" className="invisible" type="number"  placeholder="give a value"/></div>
    <div><input type="submit" onClick={init} /></div>
    <div><canvas id="mychart"></canvas></div>
    </div>
  );
}

function init() {
  os = document.getElementById('os');
  browser = document.getElementById('browser');
  type = document.getElementById('type');
  n1 = document.getElementById('n1');
  n2 = document.getElementById('n2');

  checkInputs();
};

function checkInputs() {
  if(!checkEmpty(type)) {
    if(!checkEmptyString(type.value) && type.value === 'start') {
      if(data.length === 0) data.push(handleStart());
      else {
        data.forEach(element => {
          if(element.type === 'start'){
            alert("can't have two start");
          } else data.push(handleStart());
        });
      }
    } else if(!checkEmptyString(type.value) && type.value === 'span') {
      data.forEach(element => {
        if(element.type === 'span'){
          alert("can't have two span");
        } else data.push(handleSpan());
      });
    } else if(!checkEmptyString(type.value) && type.value === 'data') {
      data.push(handleData());
    } else if(!checkEmptyString(type.value) && type.value === 'stop') {
      data.forEach(element => {
        if(element.type === 'stop'){
          alert("can't have two stop");
        } else data.push(handleStop());
      });
    }

  }
}

function checkEmpty(val) {
  return val === null || val === undefined;
}

function checkEmptyString(val) {
  return val === '';
}

function handleStart() {
  let optSpan = new Option('Span', 'span');
  type.add(optSpan);
  os.className = 'visible';
  browser.className = 'visible';
  startDate = Date.now();
  return {type: 'start', timestamp: startDate, select: ['min_response_time', 'max_response_time'], group: ['os', 'browser']};
}

// eslint-disable-next-line
function handleSpan(initDate, endDate) {
  let optData = new Option('Data', 'data');
  type.add(optData);
  n1.className = 'visible';
  n2.className = 'visible';
  return {type: 'span', timestamp: Date.now(), begin: initDate, end: endDate};
}

// eslint-disable-next-line
function handleData() {
  if(dataDate === null) dataDate = Date.now();
  let optStop = new Option('Stop', 'stop');
  type.add(optStop);
  return {type: 'data', timestamp: dataDate, os: os.value, browser: browser.value, min_response_time: n1.value, max_response_time: n2.value};
}

// eslint-disable-next-line
function handleStop() {
  return {type: 'stop', timestamp: Date.now()};
}

// eslint-disable-next-line
function drawChart(obj){
  const ctx = document.getElementById('mychart');

  new Chart(ctx, {
    type: 'line',
    data: {
      datasets: [{
        abel: 'My First Dataset',
        data: [//{type: 'start', timestamp: 1519780251293, select: ['min_response_time', 'max_response_time'], group: ['os', 'browser']},
        //{type: 'span', timestamp: 1519780251293, begin: 1519780251001, end: 1519780251002},
        {type: 'data', timestamp: 1519780251001, os: 'linux', browser: 'chrome', min_response_time: 0.1, max_response_time: 1.3},
        {type: 'data', timestamp: 1519780251001, os: 'linux', browser: 'firefox', min_response_time: 0.1, max_response_time: 1.2},
        {type: 'data', timestamp: 1519780251001, os: 'mac', browser: 'chrome', min_response_time: 0.2, max_response_time: 1.6},
        {type: 'data', timestamp: 1519780251001, os: 'mac', browser: 'firefox', min_response_time: 0.3, max_response_time: 1.4},
        {type: 'data', timestamp: 1519780251002, os: 'linux', browser: 'chrome', min_response_time: 0.2, max_response_time: 1.4},
        {type: 'data', timestamp: 1519780251002, os: 'linux', browser: 'firefox', min_response_time: 0.3, max_response_time: 1.2},
        {type: 'data', timestamp: 1519780251002, os: 'mac', browser: 'chrome', min_response_time: 0.4, max_response_time: 1.8},
        {type: 'data', timestamp: 1519780251002, os: 'mac', browser: 'firefox', min_response_time: 0.5, max_response_time: 1.7},
        /*{type: 'stop', timestamp: 1529780251293}*/],
        fill: false,
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }]
    },
    height: 400,
    width: 600,
    options: {
      scales: {
        y: {
          beginAtZero: true
        }
      },
      maintainAspectRatio: false,
      responsive: true,
      plugins: {
          legend: {
              display: false
          }
      }
    }
  });
}

export default App;
